#------------------------My Solution 2------------------------------------------
def getLongestNonRepeatingSubstring(inputStr):
    charMap = {}
    maxLen = start = 0
    for i in range(len(inputStr)):
        if charMap.get(inputStr[i]) is not None and charMap[inputStr[i]] >= start:
            maxLen = max(maxLen, i - start)
            start = charMap[inputStr[i]] + 1
        charMap[inputStr[i]] = i
    return max(maxLen, i - start + 1)

